ada orang tua dan guru cukup terampil</div><div class="t m0 xb h2 y1c ff1 fs0 fc0 sc0 ls0 ws0">Pendidikan Pancasila</div><div class="t m0 xb h2 y1d ff1 fs0 fc0 sc0 ls0 ws0">dan Kewarganegaraan</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan pengetahuan yang baik, terutama dalam</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">menelaah makna, kedudukan, dan fungsi UUD 45</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan keterampilan baik, terutama dalam</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">menyajikan telaah makna, kedudukan, fungsi UUD N RI Th.1945</div><div class="t m0 xb h2 y1c ff1 fs0 fc0 sc0 ls0 ws0">Bahasa Indonesia</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan pengetahuan yang baik, bahkan sangat baik</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">dalam menelaah penyajian dan kebahasaan iklan, slogan, poster .</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan keterampilan baik, dalam menyajikan ide,</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">pesan, ajakan berbentuk iklan,slogan, poster cukup terampil</div><div class="t m0 xb h2 y1c ff1 fs0 fc0 sc0 ls0 ws0">Matematika (Umum)</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan pengetahuan yang baik, sangat baik dalam</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">menjelaskan sistem persamaan linear dua variabel dan cukup baik</div><div class="t m0 xb h8 y20 ff1 fs4 fc0 sc0 ls0 ws0">dalam menyimpulkan persamaan garis &amp; menginterpretasikan</div><div class="t m0 xb h8 y21 ff1 fs4 fc0 sc0 ls0 ws0">grafiknya</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan keterampilan baik, dalam menyelesaikan</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">masalah barisan bilangan &amp; barisan konfigurasi cukup terampil</div><div class="t m0 xb h2 y1c ff1 fs0 fc0 sc0 ls0 ws0">Ilmu Pengetahuan Alam</div><div class="t m0 xb h2 y1d ff1 fs0 fc0 sc0 ls0 ws0">(IPA)</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan pengetahuan yang sangat baik, terutama</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">kompetensi menjelaskan usaha, pesawat sederhana, dan kerja</div><div class="t m0 xb h8 y20 ff1 fs4 fc0 sc0 ls0 ws0">otot, dan baik dalam menganalisis gerak makhluk hidup, manusia</div><div class="t m0 xb h8 y21 ff1 fs4 fc0 sc0 ls0 ws0">dan kesehatannya</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan keterampilan baik, bahkan sangat terampil</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">pada kompetensi menyajikan hasil penyelidikan pencernaan</div><div class="t m0 xb h8 y20 ff1 fs4 fc0 sc0 ls0 ws0">mekanis dan kimiawi cukup trampil dalam menyajikan karya</div><div class="t m0 xb h8 y21 ff1 fs4 fc0 sc0 ls0 ws0">gangguan dan kesehatan pada sistem gerak</div><div class="t m0 xb h2 y1c ff1 fs0 fc0 sc0 ls0 ws0">Ilmu Pengetahuan</div><div class="t m0 xb h2 y1d ff1 fs0 fc0 sc0 ls0 ws0">Sosial (IPS)</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan pengetahuan yang cukup baik dalam</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">menganalisis pengaruh interaksi sosial dalam ruang berbeda ,</div><div class="t m0 xb h8 y20 ff1 fs4 fc0 sc0 ls0 ws0">bahkan pengetahuan menelaah perubahan &amp; interaksi ruang</div><div class="t m0 xb h8 y21 ff1 fs4 fc0 sc0 ls0 ws0">Indonesia dan ASEAN baik</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan keterampilan cukup baik, bahkan terampil</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">dalam menyajikan interaksi antarruang Indonesia dan ASEAN</div><div class="t m0 xb h2 y1c ff1 fs0 fc0 sc0 ls0 ws0">Bahasa Inggris</div><div class="t m0 xb h8 y1e ff1 fs4 fc0 sc0 ls0 ws0">Memiliki penguasaan pengetahuan yang cukup baik dalam</div><div class="t m0 xb h8 y1f ff1 fs4 fc0 sc0 ls0 ws0">menerapkan teks m